def DNACount(dna):
    a = 0
    c = 0
    g = 0
    t = 0
    for char in dna:
        if char == "A":
            a = a + 1
        if char == "C":
            c = c + 1
        if char == "G":
            g = g + 1
        if char == "T":
            t = t + 1

    return str(a) + " " + str(c) + " " + str(g) + " " + str(t)

print(DNACount(''))